description:
Wild Child (2008)  

Verenigde Staten / Verenigd Koninkrijk / Frankrijk
Komedie / Romantiek
98 minuten

geregisseerd door Nick Moore
met Emma Roberts, Alex Pettyfer en Natasha Richardson

Poppy (Emma Roberts) is een rebelse meid uit Malibu. Haar vader is haar gedrag zat en stuurt haar naar een strenge Engelse kostschool. Poppy wil graag naar huis en doet er alles aan om dat voor elkaar te krijgen.


